import React from "react";
import Hash from "../components/Hash";

function GamePage({ word }) {
  console.log(word);
  return (
    <div className={"p-20 m-auto"}>
      <div className="all_hashes">
        {word.map((x, i) => (
          <Hash leter={x} key={i} />
        ))}
      </div>
      <div>
        <input type="text" name="" id="" placeholder="leter" />
        <button>GUESS</button>
      </div>
    </div>
  );
}

export default GamePage;
